function Results(props){
   console.log(props)

    return (
        <div className="Results">
            <ul class="list-group">
                {state && <li class="list-group-item">{state}</li>}
                {date && <li class="list-group-item">{date}</li>}
                {cases && <li class="list-group-item">{cases}</li>}
                {deaths && <li class="list-group-item">{deaths}</li>}
            </ul>
        </div>
    );
}
export default Results
